import React from "react";

import { useSelector } from "react-redux";

const List = (props) => {
  const my_lists = useSelector((state) => state.dictionary.list);
  console.log(my_lists);
  //화면 출력
  return (
    <div>
      <div style={{ textAlign: "center", fontSize: "50px" }}> title </div>
      <div style={{ display: "flex" }}>
        {my_lists.map((list, index) => {
          return (
            <div
              key={index}
              style={{
                maxWidth: "350px",
                border: "1px solid #ddd",
              }}
            >
              <div>{list.word}</div>
              <div>{list.explanation}</div>
              <div>{list.example}</div>
            </div>
          );
        })}
      </div>
      <a
        href="/word/add"
        style={{
          width: "50px",
          height: "50px",
          backgroundColor: "blue",
          display: "block",
          borderRadius: "50px",
          position: "fixed",
          right: "10px",
          bottom: "10px",
        }}
      ></a>
    </div>
  );
};

export default List;
